import readingTestMockData from 'app/views/pages/AdminCreateTest/components/AdminCreateReadingTest/defaultMockdata';

const TestMockData = {
	title: 'Test Name',
	author: '',
	image:
		'https://ieltsonlinetests.com/sites/default/files/styles/latest_collection/public/2020-01/MTjul2020%403x.png',
	rating: {
		voteAmount: 0,
		starAmount: 0,
	},
	publishDate: Date.now(),
	views: 0,
	testsTaken: 0,
	testDetails: {
		readingTest: readingTestMockData,
	},
};

export default TestMockData;
